import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Page = () => {
    return ( 
        <div>
            <p className="bg-success text-white text-center text-decoration-line-through mt-5 ms-5 me-5 mb-5">hello world</p>
            <p className="text-white bg-primary h1 text-center fw-light text-decoration-line-through">My Application</p>
            <p className="text-white bg-primary h1 text-center fw-bold">My Application</p>
            <a href="https://www.google.com" className="text-decoration-none text-dark btn btn-outline-info" target="_blank">Google</a>
            <button className="btn btn-group">
                <a href="#" className="btn btn-primary">Blue</a>
                <a href="#" className="btn btn-secondary">Grey</a>
                <a href="#" className="btn btn-success">Green</a>
                <a href="#" className="btn btn-danger">Red</a>
                <a href="#" className="btn btn-warning"></a>
                <a href="#" className="btn btn-info"></a>
                <a href="#" className="btn btn-light">White</a>
                <a href="#" className="btn btn-dark">Black</a>
            </button>
        </div>
     );
}

export default Page;
